script: |
  super -f text -I q11360.spq | sort > q11360.out

inputs:
  - name: q11360.spq
    data: |
      SELECT DISTINCT + col1 * - ( + col0 ) - - - col1 * + - col2 * + 82 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 NOT BETWEEN NULL AND + + col1 * col0;
  - name: tab1

outputs:
  - name: q11360.out
    data: |
